import React, { useEffect } from 'react';
import { GoogleMap, Marker } from '@react-google-maps/api';

const GoogleMapsPage = () => {
  useEffect(() => {
    // Load Google Maps API script
    const script = document.createElement('script');
    script.src = 'https://maps.googleapis.com/maps/api/js?callback=initMap';
    script.defer = true;
    script.async = true;

    script.onload = () => {
      initMap();
    };

    document.head.appendChild(script);

    return () => {
      document.head.removeChild(script);
    };
  }, []);

  const initMap = () => {
    const map = new window.google.maps.Map(document.getElementById('map'), {
      center: { lat: 37.7749, lng: -122.4194 }, // Default location (San Francisco)
      zoom: 12,
    });

    // Your map-related functionality here, for example:
    const marker = new window.google.maps.Marker({
      position: { lat: 37.7749, lng: -122.4194 },
      map: map,
      title: 'San Francisco'
    });

    // Example: Add an event listener for the marker
    marker.addListener('click', () => {
      console.log('Marker clicked!');
    });
  };

  return (
    <div>
      <h2>Google Maps Page</h2>
      <div id="map" style={{ height: '400px', marginBottom: '20px' }}></div>
    </div>
  );
};

export default GoogleMapsPage;
